INSERT INTO `alabeo_posts` VALUES (1,1,'2015-04-03 14:30:09','2015-04-03 14:30:09','Welcome to WordPress. This is your first post. Edit or delete it, then start blogging!','Hello world!','','publish','open','open','','hello-world','','','2015-04-15 13:00:02','2015-04-15 13:00:02','',0,'http://vgc.lnr.com/?p=1',0,'post','',3),(2,1,'2015-04-03 14:30:09','2015-04-03 14:30:09','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://vgc.lnr.com/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','open','open','','sample-page','','','2015-04-03 14:30:09','2015-04-03 14:30:09','',0,'http://vgc.lnr.com/?page_id=2',0,'page','',0),(12,1,'2015-04-04 04:30:27','2015-04-04 04:30:27','','Home','','publish','open','open','','home','','','2015-04-04 04:30:27','2015-04-04 04:30:27','',0,'http://vgc.lnr.com/?page_id=12',0,'page','',0),(13,1,'2015-04-04 04:30:27','2015-04-04 04:30:27','','Home','','inherit','open','open','','12-revision-v1','','','2015-04-04 04:30:27','2015-04-04 04:30:27','',12,'http://vgc.lnr.com/12-revision-v1/',0,'revision','',0),(19,1,'2015-04-05 02:49:12','2015-04-05 02:49:12',' ','','','publish','open',