ewelry[1] (/ˈdʒuːᵊlᵊri/) consists of small decorative items worn for personal adornment, such as brooches, rings, necklaces, earrings, and bracelets. Jewellery may be attached to the body or the clothes, and the term is restricted to durable ornaments, excluding flowers for example. For many centuries metal, often combined with gemstones, has been the normal material for jewellery, but other materials such as shells and other plant materials may be used. It is one of the oldest type of archaeological artefact – with 100,000-year-old beads made from Nassarius shells thought to be the oldest known jewellery.[2] The basic forms of jewellery vary between cultures but are often extremely long-lived; in European cultures the most common forms of jewellery listed above have persisted since ancient times, while other forms such as adornments for the nose or ankle, important in other cultures, are much less common. Historically, the most widespread influence on jewellery in terms of design and style have come from Asia.\r\n\r\nJewellery may be made from a wide range of materials. Gemstones and similar materials such as amber and coral, precious metals, beads, and shells have been widely used, and enamel has often been important. In most cultures jewellery can be understood as a status symbol, for its material properties, its patterns, or for meaningful symbols. Jewellery has been made to adorn nearly every body part, from hairpins to toe rings, and even genital jewellery. The patterns of wearing jewellery between the sexes, and by children and older people can vary greatly between cultures, but adult women have been the most consistent wearers of jewellery; in modern European culture the amount worn by adult males is relatively low compared with other cultures and other periods in European culture.\r\n\r\nThe word jewellery itself is derived from the word jewel, which was anglicized from the Old French \"jouel\",[3] and beyond that, to the Latin word \"jocale\", meaning plaything. In British English, New Zealand English, Hiberno-English, Australian English, and South African English it is spelled jewellery, while the spelling is jewelry in American English.[1] Both are used in Canadian English.','Jewellery or Jewelry','','publish','open','open','','jewellery-or-jewelry','','','2015-04-15 01:28:46','2015-04-15 01:28:46','',0,'http://vgc.lnr.com/?p=87',0,'post','',0),(88,1,'2015-04-15 00:40:22','2015-04-15 00:40:22','Jewellery or jewelry[1] (/ˈdʒuːᵊlᵊri/) consists of small decorative items worn for personal adornment, such as brooches, rings, necklaces, earrings, and bracelets. Jewellery may be attached to the body or the clothes, and the term is restricted to durable ornaments, excluding flowers for example. For many centuries metal, often combined with gemstones, has been the normal material for jewellery, but other materials such as shells and other plant materials may be used. It is one of the oldest type of archaeological artefact – with 100,000-year-old beads made from Nassarius shells thought to be the oldest known jewellery.[2] The basic forms of jewellery vary between cultures but are often extremely long-lived; in European cultures the most common forms of jewellery listed above have persisted since ancient times, while other forms such as adornments for the nose or ankle, important in other cultures, are much less common. Historically, the most widespread influence on jewellery in terms of design and style have come from Asia.\r\n\r\nJewellery may be made from a wide range of materials. Gemstones and similar materials such as amber and coral, precious metals, beads, and shells have been widely used, and enamel has often been important. In most cultures jewellery can be understood as a status symbol, for its material properties, its patterns, or for meaningful symbols. Jewellery has been made to adorn nearly every body part, from hairpins to toe rings, and even genital jewellery. The patterns of wearing jewellery between the sexes, and by children and older people can vary greatly between cultures, but adult women have been the most consistent wearers of jewellery; in modern European culture the amount worn by adult males is relatively low compared with other cultures and other periods in European culture.\r\n\r\nThe word jewellery itself is derived from the word jewel, which was anglicized from the Old French \"jouel\",[3] and beyond that, to the Latin word \"jocale\", meaning plaything. In British English, New Zealand English, Hiberno-English, Australian English, and South African English it is spelled jewellery, while the spelling is jewelry in American English.[1] Both are used in Canadian English.','Jewellery or Jewelry','','inherit','open','open','','87-revision-v1','','','2015-04-15 00:40:22','2015-04-15 00:40:22','',87,'http://vgc.lnr.com/87-revision-v1/',0,'revision','',0),(89,1,'2015-04-15 00:54:35','2015-04-15 00:54:35','','Is Your Pet Bird A Boy or Girl? Find Out Here!','','trash','open','open','','is-your-pet-bird-a-boy-or-girl-find-out-here','','','2015-04-15 01:32:41','2015-04-15 01:32:41','',0,'http://vgc.lnr.com/?p=89',0,'post','',0),(90,1,'2015-04-15 00:54:35','2015-04-15 00:54:35','','Is Your Pet Bird A Boy or Girl? Find Out Here!','','inherit','open','open','','89-revision-v1','','','2015-04-15 00:54:35','2015-04-15 00:54:35','',89,'http://vgc.lnr.com/89-revision-v1/',0,'revision','',0),(91,1,'2015-04-15 01:06:56','2015-04-15 01:06:56','Did you know? Useful tips on walking and fitness','Did you know? Useful tips on walking and fitness','','publish','open','open','','did-you-know-useful-tips-on-walking-and-fitness','','','2015-04-15 01:33:12','2015-04-15 01:33:12','',0,'http://vgc.lnr.com/?p=91',0,'post','',0),(92,1,'2015-04-15 01:06:37','2015-04-15 01:06:37','','Did you know? Useful tips on walking and fitness','','inherit','open','open','','2-4','','','2015-04-15 01:06:44','2015-04-15 01:06:44','',91,'http://vgc.lnr.com/wp-content/uploads/2015/04/23.jpg',0,'attachment