fice? I’m kidding, I’m kidding. I work, I work. And now, in the spirit of the season: start shopping. And for every dollar of Krusty merchandise you buy, I will be nice to a sick kid. For legal purposes, sick kids may include hookers with a cold.\r\n<ol>\r\n	<li>Jesus must be spinning in his grave!</li>\r\n	<li>We started out like Romeo and Juliet, but it ended up in tragedy.</li>\r\n	<li>I was saying “Boo-urns.”</li>\r\n	<li>I’m a Spalding Gray in a Rick Dees world.</li>\r\n</ol>\r\n<h5>Marge vs. Monorail</h5>\r\nFame was like a drug. But what was even more like a drug were the drugs. Human contact: the final frontier. Oh, so they have Internet on computers now!\r\n<h6>Homer the Great</h6>\r\nHow is education supposed to make me feel smarter? Besides, every time I learn something new, it pushes some old stuff out of my brain. Remember when I took that home winemaking course, and I forgot how to drive? I don’t like being outdoors, Smithers. For one thing, there’s too many fat children. I’ve done everything the Bible says — even the stuff that contradicts the other stuff! Homer no function beer well without. Me fail English? That’s unpossible.\r\n<div class=\"shareit bottom\"><span class=\"share-item twitterbtn\"> <iframe id=\"twitter-widget-0\" class=\"twitter-share-button twitter-tweet-button twitter-share-button twitter-count-horizontal\" style=\"width: 120px; height: 20px;\" title=\"Twitter Tweet Button\" src=\"http://platform.twitter.com/widgets/tweet_button.493c8c24c1d977b6441c6c398ad48dfb.en.html#_=1426841011304&amp;count=horizontal&amp;dnt=true&amp;id=twitter-widget-0&amp;lang=en&amp;original_referer=http%3A%2F%2Fdemo.mythemeshop.com%2Fblogging%2F2014%2F03%2F26%2Fleft-sidebar-post%2F&amp;size=m&amp;text=Is%20Your%20Pet%20Bird%20A%20Boy%20or%20Girl%3F%20Find%20Out%20Here!%20%7C%20BloggingBlogging&amp;url=http%3A%2F%2Fdemo.mythemeshop.com%2Fblogging%2F2014%2F03%2F26%2Fleft-sidebar-post%2F\" width=\"300\" height=\"150\" frameborder=\"0\" scrolling=\"no\" data-tw